text:
کالیا هم سب پشتون ایک دوسرے کے غم و دکھ میں برابر شریک ہے ایک پشتون لیڈر چاہے وہ منظور ہو محسن ہو یا علی ہو پشتون قوم اس کے ہر طرح کے حفاظت کلیے سر قربان کرنے اور خون دینے کلیے بھی تیار ہے.
@Aliwazirna50 @ManzorPashteen @mjdawar
#WeStandWithAliWazir

کالیا دا علی وزیر شاته ټول پشتون قام والاړ دې ښه سوچ وکړه کله به دې غلط قدم آخیستلو ته نه پریږدی په خپلو غلطو فیصلو دا علی وزیر نه معافی وغواړئ. 
#WeStandWithAliwazir 
#IStandWithAliWazir
